import React, { Component } from "react";
import Button from "../components/ui-elements/button"

class HomePage extends Component {
    render() {
        return (
            <Button text="Home" onClick={() => {
                console.log("hola at ya!!");
            }}
            />
        );
    }
}

export default HomePage
